import React from 'react'
import Footer from "../components/Footer";
export default function (props) {
  return (
    <div>
      {props.location.state.map((option, index) => { 
      return <div key={index}>{option.title} { option.voted && <>VOTED!</>} </div>

    })}
          <div className="container">
        <ul>
          <p className="subtitle">choose one</p>
          {props.location.state.map((vote, index) =>
            <div key={index} className="subcontent">
              <span className="itemVote" key={index}>
                {vote.title} { vote.voted && <>VOTED!</>}
              </span>
            </div>
          )}
        </ul>
      </div>
    <Footer />
    </div>
  )
}
